INSERT INTO `textbox` (`id`, `title`, `text`, `fileUrl`, `tClass`, `pictureUrl`, `sDate`, `eDate`) VALUES (1004, '主讲：《人工智能导论》、《Principles of Computer Networks》（《计算机网络原理》留学生）、《计算机网络原理》、《无线传感器网络》《人工智能及其应用》、《Principles and Design of Wireless Sensor Networks》', '教育部2018年第一批产学合作协同育人项目，“基于Python的程序设计课程教学改革”，2019.02-2020.02，项目负责人，排名：1/4；\r\n\r\n浙江工业大学校级教学改革项目，“物联网工程专业国际化人才培养模式的创新与实践”，2015.08-2016.12，项目负责人，排名1/6；\r\n\r\n2018全国高校计算机教育大会优秀论文奖，“面向国际化人才培养的物联网工程专业课程体系改革探索-以浙江工业大学为例”，2018.04，教育部高等学校计算机类专业教学指导委员会，排名：1/4；浙江省“十四五”研究生课程思政示范课程，“人工智能及其应用”，2022.12，项目负责人，1/6；\r\n\r\n浙江工业大学校级研究生核心课程建设项目，“人工智能及其应用”，2022.11-2023.12，项目负责人，1/4；', NULL, 3, NULL, NULL, NULL);
INSERT INTO `textbox` (`id`, `title`, `text`, `fileUrl`, `tClass`, `pictureUrl`, `sDate`, `eDate`) VALUES (1005, '团队简介', '主要研究领域为智能物联网、群智感知与协同、智能机器人等基础理论、核心技术及其综合解决方案，科研成果获全国吴文俊人工智能优秀青年奖（浙江省首位获奖人）、吴文俊人工智能科技进步一等奖、技术发明二等奖、浙江省技术发明二等奖、中国煤炭工业协会科学技术二等奖等7个省部级奖项，发表学术论文80多篇，包括IEEE TMC、IEEE TNNLS、IEEE IoT-J、IEEE TCAD等TOP期刊论文30多篇，1篇论文为期刊高被引论文，出版英文专著3部、3个章节，出版中文著作1部。获得授权国家发明专利20余项，软件著作权10多项。主持国家自然科学基金（青年项目、面上项目）、浙江省杰出青年科学基金、浙江省“尖兵”“领雁”项目、浙江省“揭榜挂帅”重大企业委托项目等30多个科研项目。担任多个国际期刊的编辑或客座编辑，多个国际会议主席或委员会委员；担任50多个国际顶级学术刊物审稿人和国际学术会议审稿人。同时，主持多个“智慧物联网综合平台”和“智能机器人系统”等重大横向项目，并成功应用于国家电网、杭州城市大脑、未来社区等实际场景中，产生重大经济效益和社会价值。\r\n\r\n', NULL, 4, 'server/src/main/resources/static/picture/微信图片_20230305170123.png', NULL, NULL);
